import groovy.sql.Sql

//def resultAsHTML = new StringBuffer()
//resultAsHTML.append(testRunner.testCase.getPropertyValue("TestCaseResultHTMLTable"))

def tsResult = ""
def remarks = ""
def req = ""

def Indicium_Track = testRunner.testCase.testSuite.project.getPropertyValue("PIC_NUMBER")

//Assert against database
com.eviware.soapui.support.GroovyUtils.registerJdbcDriver("com.microsoft.sqlserver.jdbc.SQLServerDriver")
String connectionString = null;
connectionString = "jdbc:sqlserver://OR03DB.staging.stamps.com:1433;databaseName=OnlineReporting;integratedSecurity=true"

def db = [url:connectionString, driver:'com.microsoft.sqlserver.jdbc.SQLServerDriver'];
Sql connectionResult = null;
try{
  connectionResult = Sql.newInstance(db.url, db.driver);
  log.info "Successfully connected to OR03DB.staging.stamps.com.";
  remarks += "Successfully connected to OR03DB.staging.stamps.com.";
}
catch(Exception e){
  log.error "Unable to connect to OR03DB.staging.stamps.com. Error message : " + e.message;
  tsResult = "FAIL"
  remarks += "\nUnable to connect to OR03DB.staging.stamps.com. Error message : " + e.message;
}	

qry = "Select * from [dbo].[sdct_Postal_UniversalPrintLog] where ConfirmationNumber = '" + Indicium_Track + "'"

def result;

try{
      log.info "Executing Query - $qry";
      req = "Executing Query - $qry";
      result = connectionResult.firstRow(qry);
      connectionResult.close();
  }
  catch (Exception e){
      log.error "Unable to get row count for SQL Query. Error message : " + e.message;
      tsResult = "FAIL"
  	 remarks += "\nUnable to get row count for SQL Query. Error message : " + e.message;
  } 

if(result == null)
{
	log.error("Query execution failed.")
	remarks += "\nQuery execution failed.";
}
else
{
	valueInDB = result.ConfirmationNumber
	if(valueInDB != "")
	{
		log.info("Transaction is created in data base")
		log.info(valueInDB)
		remarks += "\nTransaction is created in data base";
		tsResult = "PASS"
	}
	else
	{
		log.error("Transaction did not create in data base")
		log.info(valueInDB)
		remarks += "\nTransaction did not create in data base";
		tsResult = "FAIL"
	}
}

